import React, {useEffect, useRef} from "react";
import Particle from "./Particle";

const RainOnImage = ( props) => {

    const numberOfParticles = 5000;
    const canvasRef = useRef(null);
    const image1 = new Image();
    let particlesArray = [];
    let mappedImage = [];

    useEffect(() => {
        const canvas = canvasRef.current;
        let ctx = canvas.getContext('2d');
        image1.src = "data:image/png;base64,";
        

        image1.addEventListener("load", () => {
            // ctx.drawImage(image1, 0, 0, canvas.width, canvas.height);
            const pixels = ctx.getImageData( 0, 0, canvas.width, canvas.height);

            // Map image
            for (let y = 0; y<canvas.height; y++) {
                let row = [];

                for (let x = 0; x< canvas.width; x++) {
                    const index = 4 * y * pixels.width + x * 4;
                    const red = pixels.data[index];
                    const green = pixels.data[index];
                    const blue = pixels.data[index];
                    const brightness = Math.sqrt((red*red*0.299) + (green*green*0.587) + (blue*blue*0.114))/255;

                    if(brightness >= 1)
                        console.log("Too bright");

                    const cell = {brightness, red, green, blue} ;
                    row.push(cell);
                }

                mappedImage.push(row);
            }
            console.log("Mapped image crated");
        })

        //Create particles
        for (let i = 0; i< numberOfParticles; i++) {
            particlesArray.push(new Particle(canvas));
        }

        const render = () => {
            if(ctx)
                draw(canvas, ctx);
            else
                console.log("No ctx");

            window.requestAnimationFrame(render);
        }

        render();
    }, []);
    
    const draw = (canvas, ctx) => {
        ctx.globalAlpha = 0.5;
        // ctx.drawImage(image1, 0, 0, canvas.width, canvas.height);
        ctx.globalAlpha = 0.1;
        ctx.fillStyle = "rgb(0,0,0)";
        ctx.fillRect(0, 0, canvas.width, canvas.height);
        for(let i = 0; i < numberOfParticles; i++) {
            particlesArray[i].update(canvas, mappedImage);
            // ctx.globalAlpha = particlesArray[i].speed * 0.9 + 0.01;
            particlesArray[i].draw(ctx, mappedImage);
        }
    };

    return <canvas ref={canvasRef} {...props}/>
};

export default RainOnImage;
